import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

// Basic Components - let's ensure these exist and are properly imported
import Header from './components/Header';
import Footer from './components/Footer';

// Create a simple placeholder homepage component just in case
const HomePage = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>TruPath Specialty Vehicles</h1>
    <p>Welcome to our website. We're updating our content to serve you better.</p>
  </div>
);

// Create placeholder components for all routes
const AboutPage = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>About Us</h1>
    <p>Learn more about TruPath Specialty Vehicles</p>
  </div>
);

const ContactPage = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>Contact Us</h1>
    <p>Get in touch with our team</p>
  </div>
);

const DealerLocatorPage = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>Dealer Locator</h1>
    <p>Find a dealer near you</p>
  </div>
);

const BecomeDealer = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>Become a Dealer</h1>
    <p>Join our network of trusted dealers</p>
  </div>
);

const WorkTrucks = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>Work Trucks</h1>
    <p>Explore our work truck options</p>
  </div>
);

const SpecialtyVehicles = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>Specialty Vehicles</h1>
    <p>Discover our specialty vehicle lineup</p>
  </div>
);

const Buses = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>Buses</h1>
    <p>Learn about our bus options</p>
  </div>
);

const PrivacyPolicy = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>Privacy Policy</h1>
    <p>Our privacy policy will be available soon</p>
  </div>
);

const TermsOfUse = () => (
  <div className="container" style={{paddingTop: "100px", minHeight: "70vh"}}>
    <h1>Terms of Use</h1>
    <p>Our terms of use will be available soon</p>
  </div>
);

function App() {
  return (
    <Router>
      <div className="app">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/contact" element={<ContactPage />} />
            <Route path="/dealer-locator" element={<DealerLocatorPage />} />
            <Route path="/become-dealer" element={<BecomeDealer />} />
            <Route path="/work-trucks" element={<WorkTrucks />} />
            <Route path="/specialty-vehicles" element={<SpecialtyVehicles />} />
            <Route path="/buses" element={<Buses />} />
            <Route path="/privacy-policy" element={<PrivacyPolicy />} />
            <Route path="/terms-of-use" element={<TermsOfUse />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
